%Function Prototype for Piecewise Definition

function x = xt(t);
    if (t < - 1)
        x = 0;
    elseif (t >= -1 && t < 0 )
        x = 1;
    elseif (t >= 0 && t < 1 )
        x = t+1;
    elseif (t >= 1 && t < 2)
        x = 2;
    elseif (t >= 2 && t < 3 )
        x = 4-t;
    elseif (t >= 3 && t < 4 )
        x = 1;
    else
        x = 0;
    end
end
%%
%For Signal A (original signal)

t = -5 : 0.001 : 5; % you may have to adjust the start and end value of t
x = zeros(size(t));
for i = 1 : 1 : length(x)
 x(i) = xt( t(i) );
end
disp("Plot for Original Signal") %[output:0e6c85db]
plot(t,x); %[output:8211c211]
axis equal;  %[output:8211c211]
%%
%Impulse function response

t = 0:0.01:50;
%Setting up the response functions
imp = ImpulseRes(t);

function plotImp = ImpulseRes(t)
   plotImp = (exp(-0.5*t))/sqrt(49.75);
   plotImp(t<0) = 0;
end

%Plot the function
figure; %[output:33564131]
plot(t,imp,'r','Linewidth',3); %[output:33564131]
xlabel('Time (s)'); ylabel('q(t)'); %[output:33564131]
title('Impulse Response') %[output:33564131]
grid on %[output:33564131]
%%
%Step function response

t = 0:0.01:50;
%Setting up the response functions
stp = StepRes(t);

function plotStp = StepRes(t)
   plotStp = 0.05 - (0.05*exp(-0.5*t)) * (cos(sqrt(49.75)) + (sin(sqrt(49.75)))/sqrt(49.75)) ;
   plotStp (t<0) = 0;
end

%Plot the function
figure; %[output:6c42e1e3]
plot(t,stp,'r','Linewidth',3); %[output:6c42e1e3]
xlabel('Time (s)'); ylabel('q(t)'); %[output:6c42e1e3]
title('Step Response') %[output:6c42e1e3]
grid on %[output:6c42e1e3]
%%
%Ramp function response

t = 0:0.01:50;
%Setting up the response functions
rmp = RampRes(t);

function plotRmp = RampRes(t)
   plotRmp = -0.001 + (0.05*t) + (0.001*exp(-0.5*t)) * (cos(sqrt(49.75)) + (sin(sqrt(49.75)))/sqrt(49.75)) ;
   plotRmp(t<0) = 0;
end

%Plot the function
figure; %[output:8769b940]
plot(t,rmp,'r','Linewidth',3); %[output:8769b940]
xlabel('Time (s)'); ylabel('q(t)'); %[output:8769b940]
title('Ramp Response') %[output:8769b940]
grid on %[output:8769b940]
%%
% Define time vector
t = -2:0.01:6;  % From -2 to 6 seconds with 0.01 step

% Define ramp input signal
Vint = t;  % Linear ramp from -2 to 6 seconds

% Plot to verify
figure; %[output:6a5c905a]
plot(t, Vint, 'b', 'LineWidth', 2); %[output:6a5c905a]
xlabel('Time (s)'); ylabel('V_{int}(t)'); %[output:6a5c905a]
title('Linear Ramp Input Signal'); %[output:6a5c905a]
grid on; %[output:6a5c905a]
%%
% Define discrete time sample points
t_samples = [-2 -1 0 1 2 3 4 5 6];

% Corresponding Vint values at the sample points
Vint_samples = [-2 -1 0 1 2 3 4 5 6];

% Create fine time vector for plotting and simulation
t = -2:0.01:6;

% Interpolate to get continuous values from discrete points
Vint = interp1(t_samples, Vint_samples, t, 'linear', 'extrap');

% Plot to verify
figure; %[output:5419128f]
plot(t_samples, Vint_samples, 'ro', 'MarkerSize', 8, 'DisplayName', 'Data Points'); %[output:5419128f]
hold on; %[output:5419128f]
plot(t, Vint, 'b-', 'LineWidth', 2, 'DisplayName', 'Interpolated Signal'); %[output:5419128f]
xlabel('Time (s)'); ylabel('V_{int}(t)'); %[output:5419128f]
title('Piecewise Discrete Points Input Signal'); %[output:5419128f]
legend show; %[output:5419128f]
grid on; %[output:5419128f]


